window.onload=function(){const e=document.getElementById("loading");e.classList.add("loaded")};const fadeINs=document.querySelectorAll(".js-fadeIN"),fadeINleft=document.querySelector(".js-fadeINleft");fadeINs.forEach(e=>{e.classList.contains("js-fadeINleft")?gsap.fromTo(e,{autoAlpha:0,x:"-10vw"},{autoAlpha:1,x:0,duration:3,ease:"power4.out",scrollTrigger:{markers:!0,trigger:e,start:"top"}}):gsap.fromTo(e,{autoAlpha:0,x:"10vw"},{autoAlpha:1,x:0,duration:3,ease:"power4.out",scrollTrigger:{markers:!0,trigger:e,start:"top"}})});